// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.13;

interface IOracle {

    struct Content {
        string contentType;
        string value;
    }

    struct Message {
        string role;
        Content [] content;
    }

    struct OpenAiRequest {
        // "gpt-4-turbo", "gpt-4-turbo-preview" or "gpt-3.5-turbo-1106"
        string model;
        // int -20 - 20, Mapped to float -2.0 - 2.0. If bigger than 20 then null
        int8 frequencyPenalty;
        // JSON string or empty string
        string logitBias;
        // 0 for null
        uint32 maxTokens;
        // int -20 - 20, Mapped to float -2.0 - 2.0. If bigger than 20 then null
        int8 presencePenalty;
        // JSON string or empty string
        string responseFormat;
        // 0 for null
        uint seed;
        // empty str for null
        string stop;
        // 0-20, > 20 for null
        uint temperature;
        // 0-100  percentage, > 100 for null
        uint topP;
        // JSON list for tools in OpenAI format, empty for null, names have to match the supported tools
        string tools;
        // "none", "auto" or empty str which defaults to auto on OpenAI side
        string toolChoice;
        string user;
    }

    struct OpenAiResponse {
        string id;

        // either content is an empty str or functionName and functionArguments
        string content;
        string functionName;
        string functionArguments;

        uint64 created;
        string model;
        string systemFingerprint;
        // kind of pointless since its always "chat.completion"?
        string object;

        uint32 completionTokens;
        uint32 promptTokens;
        uint32 totalTokens;
    }

    struct GroqRequest {
        // "llama3-8b-8192", "llama3-70b-8192", "mixtral-8x7b-32768" or "gemma-7b-it"
        string model;
        // int -20 - 20, Mapped to float -2.0 - 2.0. If bigger than 20 then null
        int8 frequencyPenalty;
        // JSON string or empty string
        string logitBias;
        // 0 for null
        uint32 maxTokens;
        // int -20 - 20, Mapped to float -2.0 - 2.0. If bigger than 20 then null
        int8 presencePenalty;
        // JSON string or empty string
        string responseFormat;
        // 0 for null
        uint seed;
        // empty str for null
        string stop;
        // 0-20, > 20 for null
        uint temperature;
        // 0-100  percentage, > 100 for null
        uint topP;
        string user;
    }

    struct GroqResponse {
        string id;

        string content;

        uint64 created;
        string model;
        string systemFingerprint;
        // kind of pointless since its always "chat.completion"?
        string object;

        uint32 completionTokens;
        uint32 promptTokens;
        uint32 totalTokens;
    }

    struct KnowledgeBaseQueryRequest {
        string cid;
        string query;
        uint32 num_documents;
    }

    function createLlmCall(
        uint promptId
    ) external returns (uint);

    function createGroqLlmCall(
        uint promptId,
        GroqRequest memory request
    ) external returns (uint);

    function createOpenAiLlmCall(
        uint promptId,
        OpenAiRequest memory request
    ) external returns (uint);

    function createFunctionCall(
        uint functionCallbackId,
        string memory functionType,
        string memory functionInput
    ) external returns (uint i);

    function createKnowledgeBaseQuery(
        uint kbQueryCallbackId,
        string memory cid,
        string memory query,
        uint32 num_documents
    ) external returns (uint i);
}

contracts/ResumeCraftAgent.sol.content:
// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.9;
// Uncomment this line to use console.log
// import "hardhat/console.sol";
import "./interfaces/IOracle.sol";

contract ResumeCraftAgent {
    string public prompt;
    string public knowledgeBase;

    struct Message {
        string role;
        string content;
    }

    struct AgentRun {
        address owner;
        Message[] messages;
        uint256 responsesCount;
        uint8 max_iterations;
        bool is_finished;
        uint256 messagesCount;
    }

    mapping(uint256 => AgentRun) public agentRuns;
    uint256 private agentRunCount;

    event AgentRunCreated(address indexed owner, uint256 indexed runId);
    event KnowledgeBaseUpdated(string indexed newKnowledgeBaseCID);

    address private owner;
    address public oracleAddress;

    event OracleAddressUpdated(address indexed newOracleAddress);

    IOracle.OpenAiRequest private config;

    constructor(address initialOracleAddress, string memory systemPrompt) {
        owner = msg.sender;
        oracleAddress = initialOracleAddress;
        prompt = systemPrompt;

        config = IOracle.OpenAiRequest({
            model: "gpt-4-turbo-preview",
            frequencyPenalty: 21, // > 20 for null
            logitBias: "", // empty str for null
            maxTokens: 1000, // 0 for null
            presencePenalty: 21, // > 20 for null
            responseFormat: '{"type":"text"}',
            seed: 0, // null
            stop: "", // null
            temperature: 10, // Example temperature (scaled up, 10 means 1.0), > 20 means null
            topP: 101, // Percentage 0-100, > 100 means null
            tools: '[{"type":"function","function":{"name":"web_search","description":"Search the internet","parameters":{"type":"object","properties":{"query":{"type":"string","description":"Search query"}},"required":["query"]}}},{"type":"function","function":{"name":"image_generation","description":"Generates an image using Dalle-2","parameters":{"type":"object","properties":{"prompt":{"type":"string","description":"Dalle-2 prompt to generate an image"}},"required":["prompt"]}}}]',
            toolChoice: "auto", // "none" or "auto"
            user: "" // null
        });
    }

    modifier onlyOwner() {
        require(msg.sender == owner, "Caller is not owner");
        _;
    }

    modifier onlyOracle() {
        require(msg.sender == oracleAddress, "Caller is not oracle");
        _;
    }

    function setOracleAddress(address newOracleAddress) public onlyOwner {
        require(msg.sender == owner, "Caller is not the owner");
        oracleAddress = newOracleAddress;
        emit OracleAddressUpdated(newOracleAddress);
    }

    function setKnowledgeBaseCid(string memory cid) public onlyOwner {
        require(bytes(cid).length > 0, "CID cannot be empty");
        knowledgeBase = cid;
        emit KnowledgeBaseUpdated(cid);
    }

    function runAgent(
        string memory query,
        uint8 max_iterations
    ) public returns (uint256 i) {
        AgentRun storage run = agentRuns[agentRunCount];

        run.owner = msg.sender;
        run.is_finished = false;
        run.responsesCount = 0;
        run.max_iterations = max_iterations;

        Message memory systemMessage;
        systemMessage.content = prompt;
        systemMessage.role = "system";
        run.messages.push(systemMessage);
        run.messagesCount++;

        Message memory newMessage;
        newMessage.content = query;
        newMessage.role = "user";
        run.messages.push(newMessage);
        run.messagesCount++;

        uint256 currentId = agentRunCount;
        agentRunCount = agentRunCount + 1;

        if (bytes(knowledgeBase).length > 0) {
            IOracle(oracleAddress).createKnowledgeBaseQuery(
                currentId,
                knowledgeBase,
                query,
                2
            );
            emit AgentRunCreated(run.owner, currentId);
        } else {
            IOracle(oracleAddress).createOpenAiLlmCall(currentId, config);
            emit AgentRunCreated(run.owner, currentId);
        }

        return currentId;
    }

    function onOracleOpenAiLlmResponse(
        uint256 runId,
        IOracle.OpenAiResponse memory response,
        string memory errorMessage
    ) public onlyOracle {
        AgentRun storage run = agentRuns[runId];

        if (!compareStrings(errorMessage, "")) {
            Message memory newMessage;
            newMessage.role = "assistant";
            newMessage.content = errorMessage;
            run.messages.push(newMessage);
            run.responsesCount++;
            run.is_finished = true;
            return;
        }

        if (run.responsesCount >= run.max_iterations) {
            run.is_finished = true;
            return;
        }

        if (!compareStrings(response.content, "")) {
            Message memory assistantMessage;
            assistantMessage.content = response.content;
            assistantMessage.role = "assistant";
            run.messages.push(assistantMessage);
            run.responsesCount++;

            if (run.responsesCount == 1) {
                // Prompt to add necessary fonts, color, layout for PDF import
                Message memory newMessage;
                newMessage
                    .content = "Please convert the generated resume into a single-page HTML and CSS resume format. The resume should have a professional layout with fonts, colors, and a beautiful background that follows ATS (Applicant Tracking System) standards. Ensure the design is visually appealing, easy to read, and highlights the key sections such as contact information, professional summary, skills, experience, education, and any other relevant sections. Include custom styles to enhance the overall presentation while maintaining compatibility with ATS.";
                newMessage.role = "user";
                run.messages.push(newMessage);
                IOracle(oracleAddress).createOpenAiLlmCall(runId, config);
                return;
            } else if (run.responsesCount == 2) {
                Message memory newMessage;
                newMessage
                    .content = "Please generate a cover letter based on the provided job description. The cover letter should highlight my suitability for the position, emphasizing my relevant skills and experiences. Include a compelling introduction, detailed body paragraphs that align my qualifications with the job requirements, and a strong conclusion with a clear call to action.";
                newMessage.role = "user";
                run.messages.push(newMessage);
                IOracle(oracleAddress).createOpenAiLlmCall(runId, config);
                return;
            }
             else if (run.responsesCount == 3) {
                Message memory newMessage;
                newMessage
                    .content = "Please analyze the key points in the initial resume and provide the percentage of experience match to the job description to determine if the candidate is a good fit for the job. Include any relevant insights and summaries. The specific result should follow this format: analysis:";
                newMessage.role = "user";
                run.messages.push(newMessage);
                IOracle(oracleAddress).createOpenAiLlmCall(runId, config);
                return;
            }
             else if (run.responsesCount == 4) {
                Message memory newMessage;
                newMessage
                    .content = "Please analyze the changes made between the initial resume and the newly generated tailored resume. Provide a percentage of how the new resume was tailored to the job description, highlighting specific changes and improvements. The specific result should follow this format: changes analysis:";
                newMessage.role = "user";
                run.messages.push(newMessage);
                IOracle(oracleAddress).createOpenAiLlmCall(runId, config);
                return;
            }

            run.is_finished = true;
        }

        if (!compareStrings(response.functionName, "")) {
            IOracle(oracleAddress).createFunctionCall(
                runId,
                response.functionName,
                response.functionArguments
            );
            return;
        }

        run.is_finished = true;
    }

    function onOracleKnowledgeBaseQueryResponse(
        uint256 runId,
        string[] memory documents,
        string memory /*errorMessage*/
    ) public onlyOracle {
        AgentRun storage run = agentRuns[runId];
        // Retrieve the last user message
        require(
            keccak256(
                abi.encodePacked(run.messages[run.messagesCount - 1].role)
            ) == keccak256(abi.encodePacked("user")),
            "No message to add context to"
        );
        Message storage lastMessage = run.messages[run.messagesCount - 1];
        // Start with the original message content
        string memory newContent = lastMessage.content;

        // Append "Relevant context:\n" only if there are documents
        if (documents.length > 0) {
            newContent = string(
                abi.encodePacked(newContent, "\n\nRelevant context:\n")
            );
        }

        // Iterate through the documents and append each to the newContent
        for (uint256 i = 0; i < documents.length; i++) {
            newContent = string(
                abi.encodePacked(newContent, documents[i], "\n")
            );
        }

        // Finally, set the lastMessage content to the newly constructed string
        lastMessage.content = newContent;

        // Call LLM
        IOracle(oracleAddress).createOpenAiLlmCall(runId, config);
        emit AgentRunCreated(run.owner, runId);
    }

    function onOracleFunctionResponse(
        uint256 runId,
        string memory response,
        string memory errorMessage
    ) public onlyOracle {
        AgentRun storage run = agentRuns[runId];
        require(!run.is_finished, "Run is finished");
        string memory result = response;
        if (!compareStrings(errorMessage, "")) {
            result = errorMessage;
        }
        Message memory newMessage;
        newMessage.role = "user";
        newMessage.content = result;
        run.messages.push(newMessage);
        run.responsesCount++;
        IOracle(oracleAddress).createOpenAiLlmCall(runId, config);
    }

    function getMessageHistoryContents(
        uint256 agentId
    ) public view returns (string[] memory) {
        string[] memory messages = new string[](
            agentRuns[agentId].messages.length
        );
        for (uint256 i = 0; i < agentRuns[agentId].messages.length; i++) {
            messages[i] = agentRuns[agentId].messages[i].content;
        }
        return messages;
    }

    function getMessageHistoryRoles(
        uint256 agentId
    ) public view returns (string[] memory) {
        string[] memory roles = new string[](
            agentRuns[agentId].messages.length
        );
        for (uint256 i = 0; i < agentRuns[agentId].messages.length; i++) {
            roles[i] = agentRuns[agentId].messages[i].role;
        }
        return roles;
    }

    function isRunFinished(uint256 runId) public view returns (bool) {
        return agentRuns[runId].is_finished;
    }

    function compareStrings(
        string memory a,
        string memory b
    ) private pure returns (bool) {
        return (keccak256(abi.encodePacked((a))) ==
            keccak256(abi.encodePacked((b))));
    }
}

